const process = (logs) => {
   const items = logs.map(l => l.msg)
                     .filter(v => v !== 'request completed')
                     .filter(v => !v.startsWith('Version mismatch'))
                     .map(m => JSON.parse(m))
                     .map(m => ({
                        type: m.startTime ? 'startTime' : 'endTime',
                        id: m.id,
                        time: m.startTime || m.endTime
                     }))

   const reqs = _.groupBy(items, (r) => r.id)

   const times = []

   Object.keys(reqs).forEach(k => {
      const stamps = _.sortBy(reqs[k], (r) => r.time)

      for(let i = 0; i < stamps.length; i++) {
         if (stamps[i].type === 'startTime' && (i + 1 < stamps.length)) times.push(stamps[i + 1].time - stamps[i].time)
      }
   })

   return _.sum(times) / times.length
}

const mResult = process(mLogs)
const classicalResult = process(classicalLogs)

console.log('mCQRS average time', mResult)
console.log('Classical CQRS average time', classicalResult)
